A. Jagelavičiūtė: toks daiktas atrodo nusikaltimas prieš moterį „Suprantu, kad pinigai ant medžių neauga ir kad kartais svarbiau išleisti vaiką į mokyklą su sumuštiniais nei pasidažyti lūpas. Bet  soriukas  (liet. atsiprašau), man vat toks daiktas atrodo nusikaltimas prieš moterį. Iš ko turi būti priemonė, kad su gamintojo ir parduotuvės antkainiu kainuotų tiek?“, – feisbuke savo nuomone dalijosi Agnė, pridėdama nuotrauką, kurioje matyti nė trijų eurų nekainuojantys kosmetikos produktai. „Galiu tik įsivaizduoti, kaip tokia kosmetika žaloja. Geriau rinkčiausi taupyti, kasdien nesidažyti, bet įsigyti tegul ir ne ypač brangią, bet adekvačią kosmetiką, – teigė Agnė ir pridūrė, jog nėra iš tų, kurios kasdien naudoja kosmetiką. – Nevaidinsiu, šiandien į kosmetikos kainas dėmesio taip stipriai nebekreipiu, tačiau taip buvo ne visada. Užtat šiandien atkreipiau. Kokia jūsų nuomonė?“ Po šiuo įrašu Agnės feisbuko paskyroje pasipylė komentarai, kuriuose moterys reiškė tiek palaikančias mintis, tiek laikėsi savo nuomonės. Kai kurios įsitikinusios, jog ne visi produktai turi būti brangūs. Negana to, kai kuriuos žymius prekės ženklus kaltino milžiniškai antkainiais. (function(d, s, i, r) {
